on_submit.value:
async () => {
  let datas = {
    display_name: local.name,
    username: local.name,
    password: local.name,
    id_role: 2,
    is_deleted: false,
    created_date: new Date(),
    created_by: user.id,
    phone: local.phone,
    address: local.address,
    date_of_birth: local.dateBirth,
    email: local.email
  };
  let save = await db.m_user.create({
    data: datas,
  });
  if (save) {
    if (confirm("Data Saved, Input again?")) {
      local.name = null;
      local.phone = null;
      local.address = null;
      local.dateBirth = null;
      local.email = null;
      local.render();
    } else {
      local.name = null;
      local.phone = null;
      local.address = null;
      local.dateBirth = null;
      local.email = null;
      local.render();
      navigate("/institution/data/ppds-senior");
    }
  }
}

